de_embedding"],["def sum_digits(n):\u003cbr\u003e \"\"\"\u003cbr\u003e Returnthesumofdigitsofnon-negativeintegern.\u003cbr\u003e \"\"\"\u003cbr\u003e s = 0\u003cbr\u003e for i in str(n):\u003cbr\u003e     s += int(i)\u003cbr\u003e     \u003cbr\u003e return s\u003cbr\u003e","analysis.embedding.code_embedding"],["def sum_digits(n):\u003cbr\u003e    sum=0\u003cbr\u003e    if n&gt;0:\u003cbr\u003e        while n!=0:\u003cbr\u003e            i=n%10\u003cbr\u003e            sum+=i\u003cbr\u003e            n=n\u002f\u002f10\u003cbr\u003e    else:\u003cbr\u003e        n=input(\"Please write the positive number :\")\u003cbr\u003e    return sum\u003cbr\u003e\u003cbr\u003e        ","analysis.embedding.code_embedding"],["def sum_digits(n):\u003cbr\u003e    n=str(n)\u003cbr\u003e    sum=0\u003cbr\u003e    for i in n:\u003cbr\u003e        sum=sum+int(i)\u003cbr\u003e    return sum","analysis.embedding.code_embedding"],["def sum_digits(n):\u003cbr\u003e    s=str(n)\u003cbr\u003e    total=0\u003cbr\u003e    for num in s:\u003cbr\u003e        total=total+int(num)\u003cbr\u003e    return total\u003cbr\u003e#one example\u003cbr\u003eprint(sum_digits(9001))  #output 10 \u003cbr\u003e        ","analysis.embedding.code_embedding"],["def sum_digits(n):\u003cbr\u003e    if n == 0:\u003cbr\u003e        return 0\u003cbr\u003e    return n % 10 +sum_digits(n \u002f\u002f 10)\u003cbr\u003e    \u003cbr\u003e    ","analysis.embedding.code_embedding"],["def sum_digits(n):\u003cbr\u003e    \"\"\"\u003cbr\u003e    Return the sum of digits of non-negative integer n.\u003cbr\u003e    \"\"\"\u003cbr\u003e    sum = 0\u003cbr\u003e    while n != 0:\u003cbr\u003e        digit = n % 10\u003cbr\u003e        sum += digit\u003cbr\u003e        n -= digit\u003cbr\u003e        n \u002f= 10\u003cbr\u003e    return int(sum)\u003cbr\u003e\u003cbr\u003eprint(sum_digits(12345))","analysis.embedding.code_embedding"],["def sum_digits(n):\u003cbr\u003e    return sum(int(digit) for digit in str(n))\u003cbr\u003e\u003cbr\   let searchTraceIndex = null;

  function updateSearch(query) {
    // remove prior search trace
    if (searchTraceIndex !== null && gd.data && gd.data[searchTraceIndex]) {
      Plotly.deleteTraces(gd, searchTraceIndex);
      searchTraceIndex = null;
    }
    query = (query || "").toLowerCase().trim();
    if (!query) return;
    const hits = [];
    for (let i=0; i<ids.length; i++) {
      if ((ids[i] || "").toLowerCase().includes(query)) {
        hits.push(i);
      }
    }
    if (!hits.length) return;
    const trace = {
      x: hits.map(i => xs[i]),
      y: hits.map(i => ys[i]),
      mode: 'markers+text',
      text: hits.map(i => ids[i]),
      textposition: 'top center',
      marker: {
        symbol: 'star',
        size: 20,
        color: 'rgba(0,0,0,0)',
        line: { color: 'red', width: 3 }
      },
      name: 'Search',
      hoverinfo: 'skip'
    };
    Plotly.addTraces(gd, [trace]).then(idxs => {
      searchTraceIndex = idxs[0];
    });
  }

  function initControls() {
    const input = document.getElementById('searchBox');
    const btn = document.getElementById('searchBtn');
    if (!input || !btn) return;

    // Click button triggers search
    btn.addEventListener('click', () => updateSearch(input.value));

    // Pressing Enter in input triggers search
    input.addEventListener('keydown', (e) => {
      if (e.key === 'Enter') {
        e.preventDefault();
        btn.click();
      }
    });
  }

  if (gd) {
    if (gd._fullLayout) {
      initControls();
    } else {
      gd.addEventListener('plotly_afterplot', initControls, { once: true });
